import React, { useEffect, useState } from "react";
import { fetchBookings } from "../services/api";

const AdminBookings = () => {
  const [bookings, setBookings] = useState([]);
  const [filter, setFilter] = useState(""); // State to track payment status filter

  useEffect(() => {
    const fetchAllBookings = async () => {
      try {
        const data = await fetchBookings(filter); // Pass filter to API call
        setBookings(data);
      } catch (error) {
        console.error("Error fetching bookings:", error.message);
      }
    };

    fetchAllBookings();
  }, [filter]); // Re-fetch bookings when filter changes

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-4">Bookings Management</h1>

      {/* Dropdown to filter by payment status */}
      <div className="mb-4">
        <label htmlFor="filter" className="mr-2">Filter by Payment Status:</label>
        <select
          id="filter"
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
          className="border px-2 py-1 rounded"
        >
          <option value="">All</option>
          <option value="PENDING">Pending</option>
          <option value="SUCCESS">Success</option>
          <option value="FAILED">Failed</option>
        </select>
      </div>

      <table className="min-w-full bg-white border">
        <thead>
          <tr>
            <th className="px-4 py-2 border">Booking ID</th>
            <th className="px-4 py-2 border">Client Email</th>
            <th className="px-4 py-2 border">Gown Name</th>
            <th className="px-4 py-2 border">Pickup Date</th>
            <th className="px-4 py-2 border">Return Date</th>
            <th className="px-4 py-2 border">Total Price</th>
            <th className="px-4 py-2 border">Payment Status</th>
            <th className="px-4 py-2 border">Actions</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((booking) => (
            <tr key={booking._id}>
              <td className="px-4 py-2 border">{booking._id}</td>
              <td className="px-4 py-2 border">{booking.userId?.email}</td>
              <td className="px-4 py-2 border">{booking.gownId?.name}</td>
              <td className="px-4 py-2 border">{new Date(booking.startDate).toLocaleDateString()}</td>
              <td className="px-4 py-2 border">{new Date(booking.endDate).toLocaleDateString()}</td>
              <td className="px-4 py-2 border">{booking.totalPrice}</td>
              <td className="px-4 py-2 border">{booking.paymentStatus}</td>
              <td className="px-4 py-2 border">
                <button className="bg-yellow-400 px-2 py-1 rounded">Edit</button>
                <button className="bg-red-500 px-2 py-1 rounded text-white ml-2">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminBookings;
